export const LoadGraph = ({data}) => {
  const loadGraph = useLoadGraph();

  useEffect(() => {
    const graph = gexf.parse(Graph, data);
    graph.addNode("first", { x: 0, y: 0, size: 15, label: "My first node", color: "#FA4F40" });
    loadGraph(graph);
  }, [loadGraph]);

  return null;
};

export default function FonctionnementPortFranc({
  width,
  height,
  // data: inputData,
  callerProps = {},
  lang,
}) {
  const {
    mode = 'complete'
  } = callerProps;

  const [activeMode, setActiveMode] = useState(mode);
  useEffect(() => setActiveMode(mode), [mode]);

  // const complete = useMemo(() => inputData.get('fonctionnement-port-franc-complete.gexf'), [inputData]);
  // const simplified = useMemo(() => inputData.get('fonctionnement-port-franc-simplified.gexf'), [inputData]);
  return (
    <div className="FonctionnementPortFranc">
    <div className="viz-container"
      dangerouslySetInnerHTML={{
        __html: activeMode === 'complete' ? completeData({width, height}) : simplifiedData({width, height})
      }}
    />
    <div className="ui-container">
      <button 
        className={`button ${activeMode === 'complete' ? 'is-active': ''}`}
        onClick={() => setActiveMode('complete')}
      >
        {translate('FonctionnementPortFranc', 'reseau-complet', lang)}
      </button>
      <button 
        className={`button ${activeMode === 'simplified' ? 'is-active': ''}`}
        onClick={() => setActiveMode('simplified')}
      >
                {translate('FonctionnementPortFranc', 'reseau-simplifie', lang)}
      </button>
    </div>
    </div>
  )
}